  false,\n\t\"url\": null,\n\t\"notes\": \"This database contains countsu00a0and resights
  of markedu00a0adult and juvenile (non-pup) and pup Steller sea lions on rookeries
  and haulouts at Marmot and Ugamak Islands, Alaska starting in 2000. Counts and marked
  animal resights have been conducted during theu00a0breeding season (late May - early
  Aug.).u00a0 Counts and resights are used for population trend and survival analysis.
  Counts and resights are conducted from cliff-side overlooks. Non-pup and pup counts
  and resights represent only a fraction of the total number of animals that may use
  a site.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
